import React from 'react';
import Webhooks from './pages/Webhooks';

function App() {
  return (
    <div style={{ padding: '20px', maxWidth: '1000px', margin: '0 auto' }}>
      <h1 style={{ borderBottom: '1px solid #eee', paddingBottom: '10px' }}>Merchant Dashboard</h1>
      <Webhooks />
    </div>
  );
}

export default App;
